import React from "react";

function Home() {
  return (
    <div style={{ marginTop: "25px", textAlign: "center" }}>
      <h4>Welcome to Our Restaurant</h4>
      <h6 style={{ marginTop: "30px" }}>Please press the button to continue</h6>
      <button
        type="button"
        class="btn btn-primary"
        style={{ marginTop: "40px" }}
      >
        Continue
      </button>
    </div>
  );
}

export default Home;
